Method.Source:
[Form]
    public class MCRSalesTableDetailedStatus extends FormRun
    {
        InventDimCtrl_Frm_Mov   inventDimFormSetup;
}

public void init()
{
    super();
    element.updateDesign(InventDimFormDesignUpdate::Init);

    // <GTE>
    if (TaxSolutionScopeIntegrationUtil::isCompanyEnabled())
    {
        TaxDocumentLauncher.visible(true);
    }
    // </GTE>
}

void updateDesign(InventDimFormDesignUpdate mode)
{
    InventMovement localMovement = InventMovement::construct(salesLine);

    switch (mode)
    {
        case InventDimFormDesignUpdate::Init :
            if (!inventDimFormSetup)
            {
                inventDimFormSetup  = InventDimCtrl_Frm_Mov::newFromFormMovement(element, localMovement);
            }

        case InventDimFormDesignUpdate::Active :
            inventDimFormSetup.formActiveSetup(localMovement.inventDimGroupSetup(),localMovement);
            inventDimFormSetup.formSetControls(true);
            break;

        case InventDimFormDesignUpdate::FieldChange :
            inventDimFormSetup.formActiveSetup(localMovement.inventDimGroupSetup(),localMovement);
            inventDimFormSetup.formSetControls(false);
            break;

        default :
            throw error(strFmt("@SYS54195",funcName()));
    }
}

void  linkActive()
{
    QueryBuildDataSource    queryBuildDataSource;
    SalesTable              tmpSalesTable;

    tmpSalesTable   =   element.args().record();

    queryBuildDataSource = this.query().dataSourceTable(tableNum(SalesTable));
    queryBuildDataSource.clearRanges();

    queryBuildDataSource.addRange(fieldNum(SalesTable, SalesId)).value(tmpSalesTable.SalesId);

    super();
}

void  clicked()
{
    SalesTableType menuSalesTableType = salesLine.salesTable().type();

    buttonTransact.enabled        (menuSalesTableType.inventTransactInvoke());
    buttonInventOnHand.enabled    (menuSalesTableType.inventOnHandInvoke());
    buttonInventLot.enabled       (menuSalesTableType.inventLotInvoke());

    super();
}
